                double[] v12 = vector3d.sub(t.pos[1],t.pos[0]);
                double[] v13 = vector3d.sub(t.pos[2], t.pos[0]);
                double[] normal = vector3d.normalize(vector3d.cross_product(v12, v13));
                double angl = vector3d.inner_product(vl, normal);
